                                <div className="text-purple-100 text-sm font-medium uppercase tracking-wide">Quality Alerts</div>
                                <div className="text-3xl font-bold mt-2">{qualityAlerts.length}</div>
                                <div className="text-purple-100 text-sm mt-1">Poor quality</div>
                            </div>
                            <div className="text-4xl opacity-80">⚡</div>
                        </div>
                    </div>
                    <div className="bg-gradient-to-br from-green-500 to-green-600 text-white rounded-xl shadow-lg p-6 transform hover:scale-105 transition-transform">
                        <div className="flex items-center justify-between">
                            <div>
                                <div className="text-green-100 text-sm font-medium uppercase tracking-wide">Top Performers</div>
