                                <div className="text-green-100 text-sm mt-1">High quality</div>
                            </div>
                            <div className="text-4xl opacity-80">🏆</div>
                        </div>
                    </div>
                    <div className="bg-gradient-to-br from-gray-600 to-gray-700 text-white rounded-xl shadow-lg p-6 transform hover:scale-105 transition-transform">
                        <div className="flex items-center justify-between">
                            <div>
                                <div className="text-gray-100 text-sm font-medium uppercase tracking-wide">Total MRs</div>
                                <div className="text-3xl font-bold mt-2">{mrPerformance.length}</div>
                                <div className="text-gray-100 text-sm mt-1">Active today</div>
                            </div>
                            <div className="text-4xl opacity-80">👥</div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default EmergencyDashboard;
